import React from "react";
import { List, Card, Avatar, Row } from "antd";
import blockchain from "./blockchain.jpg";
import "./App.css";
const { Meta } = Card;

export default function technologies() {
  const data = [
    {
      title: "Title 1"
    },
    {
      title: "Title 2"
    },
    {
      title: "Title 3"
    },
    {
      title: "Title 4"
    },
    {
      title: "Title 5"
    },
    {
      title: "Title 6"
    }
  ];
  return (
    <div className="center">
      <Row
        align="middle"
        type="flex"
        style={{ alignItems: "center", justifyContent: "center" }}
      >
        <List
          grid={{
            gutter: 16,
            xs: 2,
            sm: 4,
            md: 6,
            lg: 8,
            xl: 10,
            xxl: 12
          }}
          dataSource={data}
          renderItem={item => (
            <List.Item>
              <Card
                hoverable
                style={{ width: "100%" }}
                cover={<img alt={item.title} src={blockchain} />}
              >
                <Meta
                  title={item.title}
                  // description="www.instagram.com"
                />
              </Card>
            </List.Item>
          )}
        />
      </Row>
    </div>
  );
}
